import React from "react";
import Button from "../UI/Buttons/Button/Button";
import styles from "./Summary.module.css";
const Summary = props => {
  return (
    <>
      <h3>Review</h3>
      <h5>I am a {props.identityValue}</h5>
      <h5>Writing to my {props.whoValue}</h5>
      <h5>And I want to say...</h5>
      {props.messageValue}
      <Button type="prev" name="submit" switchHandler={props.switchHandler} />
      <Button type="submit" switchHandler={props.switchHandler} />
    </>
  );
};

export default Summary;
